/*-
 * Variable point scalar multiplication with "regular" wnaf.
 */
static void var_smul_rwnaf(pt_aff_t *out, const unsigned char scalar[32],
                           const pt_aff_t *P) {
    int i, j, d, diff, is_neg;
    pt_prj_t Q = {0}, lut = {0};
    pt_prj_t precomp[DRADIX / 2];

    // printf("%s\n", "I am here");

    uint64_t rnaf2[104U] = { 0U };

    precomp_wnaf(precomp, P);
    scalar_rwnaf(rnaf2, scalar);

    /* initialize accumulator to high digit */
    d = (rnaf2[102] - 1) >> 1;

    // printf("%d\n", d);

    for (j = 0; j < 16; j++) {
        uint64_t diff = FStar_UInt64_eq_mask(d, (uint64_t)j);
        fiat_secp256r1_selectznz(Q.X, diff, Q.X, precomp[j].X);
        fiat_secp256r1_selectznz(Q.Y, diff, Q.Y, precomp[j].Y);
        fiat_secp256r1_selectznz(Q.Z, diff, Q.Z, precomp[j].Z);
    }

    for (i = 50; i >= 0; i--) {
        for (j = 0; j < 5; j++) point_double(&Q, &Q);
        d = rnaf2[ 2 * i];
        is_neg = rnaf2[2 * i + 1];
        d = (d - 1) >> 1;

        for (j = 0; j < 16; j++) {
            uint64_t diff = FStar_UInt64_eq_mask(d, (uint64_t)j);
            fiat_secp256r1_selectznz(lut.X, diff, lut.X, precomp[j].X);
            fiat_secp256r1_selectznz(lut.Y, diff, lut.Y, precomp[j].Y);
            fiat_secp256r1_selectznz(lut.Z, diff, lut.Z, precomp[j].Z);
        }

        fiat_secp256r1_opp(out->Y, lut.Y);
        fiat_secp256r1_selectznz(lut.Y, is_neg, lut.Y, out->Y);
        point_add_proj(&Q, &Q, &lut);
    }

    /* conditionally subtract P if the scalar was even */
    fe_copy(lut.X, precomp[0].X);
    fiat_secp256r1_opp(lut.Y, precomp[0].Y);
    fe_copy(lut.Z, precomp[0].Z);
    point_add_proj(&lut, &lut, &Q);
    fiat_secp256r1_selectznz(Q.X, scalar[0] & 1, lut.X, Q.X);
    fiat_secp256r1_selectznz(Q.Y, scalar[0] & 1, lut.Y, Q.Y);
    fiat_secp256r1_selectznz(Q.Z, scalar[0] & 1, lut.Z, Q.Z);

    /* convert to affine -- NB depends on coordinate system */
    fiat_secp256r1_inv(Q.Z, Q.Z);
    fiat_secp256r1_mul(out->X, Q.X, Q.Z);
    fiat_secp256r1_mul(out->Y, Q.Y, Q.Z);
}

/*-
 * Fixed scalar multiplication: comb with interleaving.
 */
static void fixed_smul_cmb(pt_aff_t *out, const unsigned char scalar[32]) {
    int i, j, k, d, diff, is_neg = 0;
    int8_t rnaf[52] = {0};
    pt_prj_t Q = {0}, R = {0};
    pt_aff_t lut = {0};

    scalar_rwnaf(rnaf, scalar);

    /* initalize accumulator to inf */
    fe_set_zero(Q.X);
    fe_copy(Q.Y, const_one);
    fe_set_zero(Q.Z);



    for (i = 1; i >= 0; i--) {
        for (j = 0; i != 1 && j < RADIX; j++) point_double(&Q, &Q);
        for (j = 0; j < 27; j++) {
            if (j * 2 + i > 51) continue;
            d = rnaf[j * 2 + i];
            /* is_neg = (d < 0) ? 1 : 0 */
            is_neg = (d >> (8 * sizeof(int) - 1)) & 1;
            /* d = abs(d) */
            d = (d ^ -is_neg) + is_neg;
            d = (d - 1) >> 1;
            for (k = 0; k < DRADIX / 2; k++) {
                diff = (1 - (-(d ^ k) >> (8 * sizeof(int) - 1))) & 1;
                fiat_secp256r1_selectznz(lut.X, diff, lut.X, lut_cmb[j][k].X);
                fiat_secp256r1_selectznz(lut.Y, diff, lut.Y, lut_cmb[j][k].Y);
            }
            /* negate lut point if digit is negative */
            fiat_secp256r1_opp(out->Y, lut.Y);
            fiat_secp256r1_selectznz(lut.Y, is_neg, lut.Y, out->Y);
            point_add_mixed(&Q, &Q, &lut);
        }
    }

#if defined(_MSC_VER)
#pragma warning(pop)
#endif

    /* conditionally subtract P if the scalar was even */
    fe_copy(lut.X, lut_cmb[0][0].X);
    fiat_secp256r1_opp(lut.Y, lut_cmb[0][0].Y);
    point_add_mixed(&R, &Q, &lut);
    fiat_secp256r1_selectznz(Q.X, scalar[0] & 1, R.X, Q.X);
    fiat_secp256r1_selectznz(Q.Y, scalar[0] & 1, R.Y, Q.Y);
    fiat_secp256r1_selectznz(Q.Z, scalar[0] & 1, R.Z, Q.Z);

    /* convert to affine -- NB depends on coordinate system */
    fiat_secp256r1_inv(Q.Z, Q.Z);
    fiat_secp256r1_mul(out->X, Q.X, Q.Z);
    fiat_secp256r1_mul(out->Y, Q.Y, Q.Z);
}

/*-
 * Wrapper: simultaneous scalar mutiplication.
 * outx, outy := a * G + b * P
 * where P = (inx, iny).
 * Everything is LE byte ordering.
 */
static void point_mul_two(unsigned char outx[32], unsigned char outy[32],
                          const unsigned char a[32], const unsigned char b[32],
                          const unsigned char inx[32],
                          const unsigned char iny[32]) {
    pt_aff_t P;

    fiat_secp256r1_from_bytes(P.X, inx);
    fiat_secp256r1_from_bytes(P.Y, iny);
    fiat_secp256r1_to_montgomery(P.X, P.X);
    fiat_secp256r1_to_montgomery(P.Y, P.Y);
    /* simultaneous scalar multiplication */
    var_smul_wnaf_two(&P, a, b, &P);

    fiat_secp256r1_from_montgomery(P.X, P.X);
    fiat_secp256r1_from_montgomery(P.Y, P.Y);
    fiat_secp256r1_to_bytes(outx, P.X);
    fiat_secp256r1_to_bytes(outy, P.Y);
}

/*-
 * Wrapper: fixed scalar mutiplication.
 * outx, outy := scalar * G
 * Everything is LE byte ordering.
 */
static void point_mul_g(unsigned char outx[32], unsigned char outy[32],
                        const unsigned char scalar[32]) {
    pt_aff_t P;


    /* fixed scmul function */
    fixed_smul_cmb(&P, scalar);
    fiat_secp256r1_from_montgomery(P.X, P.X);
    fiat_secp256r1_from_montgomery(P.Y, P.Y);
    fiat_secp256r1_to_bytes(outx, P.X);
    fiat_secp256r1_to_bytes(outy, P.Y);
}

/*-
 * Wrapper: variable point scalar mutiplication.
 * outx, outy := scalar * P
 * where P = (inx, iny).
 * Everything is LE byte ordering.
 */
static void point_mul(unsigned char outx[32], unsigned char outy[32],
                      const unsigned char scalar[32],
                      const unsigned char inx[32],
                      const unsigned char iny[32]) {
    pt_aff_t P;


// printf("%s\n", "Test");
    fiat_secp256r1_from_bytes(P.X, inx);
    fiat_secp256r1_from_bytes(P.Y, iny);
    fiat_secp256r1_to_montgomery(P.X, P.X);
    fiat_secp256r1_to_montgomery(P.Y, P.Y);
    /* var scmul function */
    var_smul_rwnaf(&P, scalar, &P);
    fiat_secp256r1_from_montgomery(P.X, P.X);
    fiat_secp256r1_from_montgomery(P.Y, P.Y);
    fiat_secp256r1_to_bytes(outx, P.X);
    fiat_secp256r1_to_bytes(outy, P.Y);
}

