    VALGRIND_MAKE_MEM_UNDEFINED(k_b, 32);
    point_mul_g(x_b, y_b, k_b);

    /* val: point_mul_two */
    RAND_bytes(k_b, 32);
    RAND_bytes(l_b, 32);
    VALGRIND_MAKE_MEM_UNDEFINED(k_b, 32);
    VALGRIND_MAKE_MEM_UNDEFINED(l_b, 32);
    point_mul_two(x_b, y_b, k_b, l_b, x_b, y_b);

    printf("Using VALGRIND_MAKE_MEM_UNDEFINED...\n");
