#define NUM_TIMINGS (1 << 8)

static void benchmark() {
    int i;
    uint64_t start, stop;
    uint64_t *timings = NULL;
    unsigned char x_b[32];
    unsigned char y_b[32];
    unsigned char k_b[32];
    unsigned char l_b[32];

    assert((timings = malloc(sizeof(uint64_t) * NUM_TIMINGS)) != NULL);

    RAND_bytes(x_b, 32);
    RAND_bytes(y_b, 32);

    /* bench: inversion */
    for (i = 0; i < NUM_TIMINGS; i++) {
        fe_t b;
        RAND_bytes(k_b, 32);
        fiat_secp256r1_from_bytes(b, k_b);
        fiat_secp256r1_to_montgomery(b, b);
        start = rdtsc();
        fiat_secp256r1_inv(b, b);
        stop = rdtsc();
        timings[i] = stop - start;
    }
    qsort(timings, NUM_TIMINGS, sizeof(uint64_t), compare_ints);
    printf("secp256r1:fe_inv median cycles:%" PRIu64 "\n",
           timings[NUM_TIMINGS / 2]);

    /* bench: point_mul */
    for (i = 0; i < NUM_TIMINGS; i++) {
        RAND_bytes(k_b, 32);
        start = rdtsc();
        point_mul(x_b, y_b, x_b, y_b, k_b);
        stop = rdtsc();
        timings[i] = stop - start;
    }
    qsort(timings, NUM_TIMINGS, sizeof(uint64_t), compare_ints);
    printf("secp256r1:point_mul median cycles:%" PRIu64 "\n",
           timings[NUM_TIMINGS / 2]);

    /* bench: point_mul_g */
    for (i = 0; i < NUM_TIMINGS; i++) {
        RAND_bytes(k_b, 32);
        start = rdtsc();
        point_mul_g(x_b, y_b, k_b);
        stop = rdtsc();
        timings[i] = stop - start;
    }
    qsort(timings, NUM_TIMINGS, sizeof(uint64_t), compare_ints);
    printf("secp256r1:point_mul_g median cycles:%" PRIu64 "\n",
           timings[NUM_TIMINGS / 2]);

    /* bench: point_mul_two */
    for (i = 0; i < NUM_TIMINGS; i++) {
        RAND_bytes(k_b, 32);
        RAND_bytes(l_b, 32);
        start = rdtsc();
        point_mul_two(x_b, y_b, k_b, l_b, x_b, y_b);
        stop = rdtsc();
        timings[i] = stop - start;
    }
    qsort(timings, NUM_TIMINGS, sizeof(uint64_t), compare_ints);
    printf("secp256r1:point_mul_two median cycles:%" PRIu64 "\n",
           timings[NUM_TIMINGS / 2]);

    free(timings);
}

/* big endian string to little endian bytes */
void hex2bytes(unsigned char *out, const char *in) {
    int i;
    int len = strlen(in);

    assert(out != NULL);
    assert(in != NULL);
    assert(len == 64);

    for (i = len - 2; i >= 0; i -= 2, out++)
        assert(sscanf(in + i, "%02hhx", out) == 1);
}

static void test_fe_inv(const char *in) {
    int i;
    fe_t a, inv, b;
    unsigned char abytes[32];
    unsigned char bbytes[32];
    unsigned char ibytes[32];

    hex2bytes(abytes, in);
    fiat_secp256r1_from_bytes(a, abytes);
    fiat_secp256r1_to_montgomery(a, a);
    fiat_secp256r1_inv(inv, a);
    fiat_secp256r1_mul(b, a, inv);
    fiat_secp256r1_from_montgomery(b, b);
    fiat_secp256r1_to_bytes(bbytes, b);

    /* sanity check inverse */
    assert(bbytes[0] == 1);
    for (i = 1; i < 32; i++) assert(bbytes[i] == 0);

    /* output inverse */
    fiat_secp256r1_from_montgomery(inv, inv);
    fiat_secp256r1_to_bytes(ibytes, inv);

    for (i = 31; i >= 0; i--) printf("%02x", ibytes[i]);
    printf("#\n");
}

static void test_scmul(const char *a, const char *b, const char *x,
                       const char *y) {
    int i;
    unsigned char b_a[32];
    unsigned char b_b[32];
    unsigned char b_x[32];
    unsigned char b_y[32];

    assert(a != NULL || b != NULL);

    if (a != NULL && b == NULL) {
        /* convert strings to hex */
        hex2bytes(b_a, a);
        /* run KAT for fixed scalar multiplication */
        point_mul_g(b_x, b_y, b_a);
    } else if (a == NULL && b != NULL) {
        assert(x != NULL && y != NULL);
        hex2bytes(b_x, x);
        hex2bytes(b_y, y);
        /* convert strings to hex */
        hex2bytes(b_b, b);
        /* run KAT for variable scalar multiplication */
        point_mul(b_x, b_y, b_b, b_x, b_y);
    } else {
        assert(x != NULL && y != NULL);
        hex2bytes(b_x, x);
        hex2bytes(b_y, y);
        /* convert strings to hex */
        hex2bytes(b_a, a);
        hex2bytes(b_b, b);
        /* run KAT for simultaneous scalar multiplication */
        point_mul_two(b_x, b_y, b_a, b_b, b_x, b_y);
    }

    /* output resulting point */
    for (i = 31; i >= 0; i--) printf("%02x", b_x[i]);
    printf("#");
    for (i = 31; i >= 0; i--) printf("%02x", b_y[i]);
    printf("#\n");
}

#define STRESS_ITS (1 << 16)

static void test_stress(int is_g) {
    int i, j;
    unsigned char b_a[32] = {0};
    unsigned char b_x[32];
    unsigned char b_y[32];

    /* fetch g */
    b_a[0] = 1;
    point_mul_g(b_x, b_y, b_a);

    for (i = 0; i < STRESS_ITS; i++) {
        /* new scalar is XOR of previous coords */
        for (j = 0; j < 32; j++) b_a[j] = b_x[j] ^ b_y[j];
        /* take another step on the walk */
        if (is_g)
            point_mul_g(b_x, b_y, b_a);
        else
            point_mul(b_x, b_y, b_a, b_x, b_y);
    }

    /* output resulting point */
    for (i = 31; i >= 0; i--) printf("%02x", b_x[i]);
    printf("#");
    for (i = 31; i >= 0; i--) printf("%02x", b_y[i]);
    printf("#\n");
}

int main(int argc, char **argv) {
    assert(argc > 1 && argv[1][0] == '-');

    if (argv[1][1] == 'i') {
        assert(argc == 3);
        test_fe_inv(argv[2]);
    }

    if (argv[1][1] == 's') {
        assert(argc == 5);
        test_scmul(NULL, argv[2], argv[3], argv[4]);
    }

    if (argv[1][1] == 'S') {
        assert(argc == 3);
        test_scmul(argv[2], NULL, NULL, NULL);
    }

    if (argv[1][1] == '2') {
        assert(argc == 6);
        test_scmul(argv[2], argv[3], argv[4], argv[5]);
    }

    if (argv[1][1] == 'b') {
        assert(argc == 2);
        benchmark();
    }

    if (argv[1][1] == 't') {
        assert(argc == 2);
        test_stress(0);
    }

    if (argv[1][1] == 'T') {
        assert(argc == 2);
        test_stress(1);
    }

#ifdef ECCKIILA_VALIDATION
    if (argv[1][1] == 'V') {
        assert(argc == 2);
        validation();
    }
#endif

    return 0;
}
